const Reducer = (state, action) => {
  switch(action.type) {
    case "SET_USER":
        state = {
          user: action.user,
          token: action.token
        }
      break;

    case "CLEAR":
      break;

    default: 
      return state;
  }

  return state;
}

export default Reducer;
